    e.preventDefault()
    fetch('http://localhost:3000/login', {
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      },
      body: JSON.stringify({  })
    })
  }

  return(
    <form className="sign-in-form">
      Sign In
      <br/>
      Email: <input type="email" name="email" placeholder="Enter Email" value={email} onChange={setEmail}/>
      <br/>
      Password: <input type="password" name="password" placeholder="Enter Password" value={password} onChange={setPassword}/>
      <br/>
      <input type="submit" name="submit" value="Submit" onSubmit={() => onSubmit(email, password)}/>
    </form>
  )
}

export default SignInForm
